Product Description

Advance your math skills

Teach Yourself Mathematics is packed with worked examples, clear explanations, and exercises with answers. It covers basic math, algebra, geometry, percentages, fractions, probability, and more.
About the Author
Trevor Johnson and Hugh Neill are both well-established authors and math consultants. Trevor is the Chief Examiner for Edexcel's International GCSE and was joint editor and author of the recently published Edexcel GCSE Mathematics series. 
